import React from "react";
import styled from "styled-components";
import { PagesWrap } from "../styles/Template";
import MainBtn from "../styles/buttons/MainBtn";
import img1 from "../images/main/main_img.jpg";

const MainPage = () => {
  return (
    <PagesWrap>
      <h1 style={{ fontSize: "3rem" }}>산리오 캐릭터 키링 뽑기</h1>
      <img src={img1} />
      <MainBtn>Start</MainBtn>
      <MainBtn>회원가입/로그인</MainBtn>
    </PagesWrap>
  );
};

const Btn = styled.div`
  width: 17rem;
  height: 4rem;
  line-height: 4rem;
  font-size: 1.5rem;
  margin: 1rem;
`;

export default MainPage;
